import './App.css'
 function Header(){
  return(
    <>
      <div>
        <ul className='headerUl'>
          <li className='headerLi' key='top250'>Top 250 Movies</li>
          <li className='headerLi'key='top100'>Top 100 Movies</li>
          <li className='headerLi' key='topbycategory'>Top 100 Movies By Category</li>
        </ul>
      </div>
    </>
  )
}

function ImageArea(){
  return(
    <>
    <div>
      <h1>
      Create Your Dream Movie List with Bera.Dev
      </h1>

    </div>
    </>
  )
}


export default function App(){
  return(
    <>
    <Header />
    <ImageArea />

    </>
  )
}
